import React from 'react';
import logo from "../assets/logo.png";
import pfp from "../assets/pfp.png";


const Navbar = () => {
    return <div>
        <div className=''>
            <img src={logo} alt='asd' className='w-20 h-20' />
        </div>
        <div className=''>
            Home
        </div>
        <div className='profile'>
            <img src={pfp} className='w-20 h-20'/>
        </div>
    </div>;
};

export default Navbar;
